import './App.css';
import Link from './Components/Link';
import ApplicantLogin from './Components/ApplicantLogin';

function App() {
  return (
    <div className="">
      <header className="App-header">
        <h2>Interview Hub</h2>
      </header>
      <ApplicantLogin></ApplicantLogin>
      <div className='flex'>
        <Link to={"/confirmExam"}>Login</Link>
      </div>
    </div> 
  );
}

export default App;
